import React, { Component } from "react";

class Title extends Component {
    render() {
        return (
            <div className="page-header">
                <h1>
                    ToDo List <small>ReactJS Demo </small>
                </h1>
                <h2>
                    <small>Nguyễn Hữu Tấn Đạt - 51702075 </small>
                </h2>
            </div>
        );
    }
}
export default Title;
